value:
admin {
    label #acs-subsite.Administration#
    url admin/configure
    selected_patterns {
        admin/*
        shared/parameters
    }
    subsections {
        configuration {
            label #acs-subsite.Configuration#
            url admin/configure
        }
        applications {
            label #acs-subsite.Applications#
            folder admin/applications
            selected_patterns {
                *
            }
        }
        subsite_add {
            label #acs-subsite.New_Subsite#
            url admin/subsite-add
        }
        permissions {
            label #acs-subsite.Permissions#
            url admin/permissions
        }
        parameters {
            label #acs-subsite.Parameters#
            url shared/parameters
        }
        advanced {
            label #acs-subsite.Advanced#
            folder admin
            selected_patterns {
                site-map/*
                groups/*
                group-types/*
                rel-segments/*
                rel-types/*
                host-node-map/*
                object-types/*
            }
        }
    }
}
